import logo from './logo.svg';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { AppBar, Box, Divider, Grid, IconButton, Stack, Tab, Tabs, Typography } from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import FilterVintageIcon from '@mui/icons-material/FilterVintage';
import './App.css';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import MailIcon from '@mui/icons-material/Mail';
import { styled } from '@mui/system';

function WavyDivider() {
  return (
    <Box
      sx={{
        width: '100%',
        height: '30px',  // Increased height to accommodate taller waves
        overflow: 'hidden',
        lineHeight: 0,
        marginTop: '30px',
        marginBottom: '-6px',
      }}
    >
      <svg
        viewBox="0 0 1200 50"  // Adjusted viewBox for taller peaks
        preserveAspectRatio="none"
        style={{
          width: '100%',
          height: '100%',
          fill: 'none',         // No fill for the wave
          stroke: '#b4bb73',    // The color of the wave
          strokeWidth: 2,       // Keep the stroke thin like MUI Divider
        }}
      >
        <path
          d="M0,25 C30,0 60,50 90,25 C120,0 150,50 180,25 C210,0 240,50 270,25 C300,0 330,50 360,25 C390,0 420,50 450,25 C480,0 510,50 540,25 C570,0 600,50 630,25 C660,0 690,50 720,25 C750,0 780,50 810,25 C840,0 870,50 900,25 C930,0 960,50 990,25 C1020,0 1050,50 1080,25 C1110,0 1140,50 1170,25 C1200,0 1230,50 1260,25"
        />
      </svg>
    </Box>
  );
}




function App() {
    const theme = createTheme({
        palette: {
            primary: {
              main:  '#da8129',
              dark: '#ffffff',
              light: '#ffffff',
              contrastText: 'rgba(0,0,0,0.87)',
            },
            secondary: {
              main: '#FD9584',
            },
            third: {
              main: '#b4bb73'
            },
            background: {
              paper: '#ffffff',
              default: '#fff6ec',
            },
        },
        components: {
            MuiTab: {
                styleOverrides: {
                    root: {
                        color: '#da8129', // Customize text color
                        textTransform: 'lowercase',
                        fontFamily: [
                            '-apple-system',
                            'BlinkMacSystemFont',
                            '"Segoe UI"',
                            'Roboto',
                            '"Helvetica Neue"',
                            'Arial',
                            'sans-serif',
                            '"Apple Color Emoji"',
                            '"Segoe UI Emoji"',
                            '"Segoe UI Symbol"',
                        ].join(','),
                        '&.Mui-selected': {
                            color: '#da8129', // Customize selected tab text color
                            borderBottom: '2px solid transparent', // Base border
                            backgroundImage: `url('data:image/svg+xml;utf8,<svg xmlns="http://www.w3.org/2000/svg" width="100" height="10"><path d="M0 5 C 10 0, 20 10, 30 5, 40 0, 50 10, 60 5, 70 0, 80 10, 90 5, 100 0" stroke="%23b4bb73" fill="transparent" stroke-width="2"/></svg>')`,
                            backgroundRepeat: 'no-repeat',
                            backgroundPosition: 'bottom center',
                            backgroundSize: 'contain',
                        },
                    },
                },
            },
            MuiTypography: {
                styleOverrides: {
                    root: {
                        fontFamily: [
                            '-apple-system',
                            'BlinkMacSystemFont',
                            '"Segoe UI"',
                            'Roboto',
                            '"Helvetica Neue"',
                            'Arial',
                            'sans-serif',
                            '"Apple Color Emoji"',
                            '"Segoe UI Emoji"',
                            '"Segoe UI Symbol"',
                        ].join(',')
                    }
                }
            },
            MuiDivider: {
                styleOverrides: {
                    root: {
                        color: '#da8129'
                    }
                }
            }
        }
    })

    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Box sx={{display: 'flex', flexDirection: 'column', minHeight: '100vh'}}>
                <Box sx={{flexGrow:1}}>
                    <Stack alignItems="center" direction="row" sx={{display: 'flex', width: '100%'}}>
                        <Grid container>
                            <Grid item xs={8} md={8} sx={{pl:1}}>
                                <Stack alignItems="center" direction="row" >
                                    <FilterVintageIcon sx={{mt:2.5, ml:1, color: '#b4bb73'}} />
                                    <Typography sx={{alignContent: 'center', pl: 1, pt:2, fontFamily: "Berkshire Swash"}} variant='h4' color="primary.main"> Sega Birhane</Typography>
                                    <FilterVintageIcon sx={{mt:2.5, ml:1, color: '#b4bb73'}} />
                                </Stack>
                            </Grid>
                            <Grid item xs={12} md={4}>
                                <Tabs
                                    sx={{
                                        '& .MuiTabs-indicator': {
                                            display: 'none', // This hides the default underline
                                        },
                                        justifyContent: 'flex-end',
                                        alignItems: 'flex-end',
                                        mt:1,
                                    }}
                                    value={0}
                                >
                                    <Tab  label="About Me"/>
                                    <Tab  label="projects"/>
                                    <Tab  label="resume"/>
                                    <Tab  label="contact me"/>
                                </Tabs>
                            </Grid>
                        </Grid>
                     </Stack>
                     <Grid container sx={{mt:8, ml:2}} spacing={1}>
                        <Grid item sx={{display: 'flex', alignContent: 'center', justifyContent: 'left'}} lg={4} md={5} sm={8}>
                                <Box sx={{width: '350px', height: "475px", border: '15px solid #Cdd9C5' }}>
